import './App.css';
import { AppBar } from '@mui/material';
import { Toolbar } from '@mui/material';
import { Typography } from '@mui/material';
import CarList from './components/CarsList';


function App() {
  return (
    <div className="App">
      <AppBar position="static" style={{ display: 'flex' }}>
      <Toolbar>
          <img src="" alt="Car" style={{ width: '30px', marginRight: '10px' }} /> 
          <Typography variant="h1" >Carshop</Typography>
        </Toolbar>
      </AppBar>
      <CarList />
    </div>
  );
}

export default App;
